function load_ajax_end_page(o) {
    grecaptcha.ready(function () {
      grecaptcha.execute(re_pub, {action: "submit"}).then(function (i) {
        const e = $(".load-more-end-butt"),
            n = e.find("span");
        const s = $(".spinner-loading-data");
        var t = jQuery("[name=csrfmiddlewaretoken]").val();
        $.ajax({
          url: load_u,
          type: "POST",
          data: {
            csrfmiddlewaretoken: t,
            validtoken: vtok,
            typeload: o,
            re_token: i,
          },
          beforeSend: function () {
            s.css("display", "inline-block");
            AOS.refresh();
          },
          success: function (o) {
            $(".row").append(o),
              AOS.refresh(),
              $(document).ready(function () {
              $('[data-toggle="tooltip"]').tooltip();
            });
            first_load = true;
            load_freeze = false;
            s.css("display", "none");

            if ($("#error_finish_feed").text()) {
                load_freeze = true;
            }
          },
          error: function () {
            alert("Error. Failed to get a response from the server. Try reloading the page."), s.css("display", "none");
            first_load = true, load_freeze = false;
          },
        });
      });
    });
}
